import Link from "next/link";

const linkStyle = {
  marginRight: 15,
  backgroundColor: "DodgerBlue",
  "text-decoration": "none",
};

export default function Header() {
  return (
    <div>
      <Link href="/">
        <a style={linkStyle}>UNO</a>
      </Link>
      <Link href="/play">
        <a style={linkStyle}>Play</a>
      </Link>
    </div>
  );
}
